import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import { Nav, NavItem, Collapse, Navbar, NavbarBrand, NavbarToggler, Row, Col,} from 'reactstrap';
import PropTypes from 'prop-types';

//import { AppAsideToggler, } from '@coreui/react';
//import logo from '../../assets/img/brand/logo.svg'
//import sygnet from '../../assets/img/brand/sygnet.svg'

const propTypes = {
  children: PropTypes.node,
};

const defaultProps = {};

class DefaultHeader extends Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }

  render() {

    // eslint-disable-next-line
    const { children, ...attributes } = this.props;

    return (
      <div>
        <Navbar dark expand="md" className="theme-hd">
          <Row>
            <Col xs="12" md="1">
            <NavbarBrand href="/dashboard">AS+</NavbarBrand>
            <NavbarToggler onClick={this.toggle} />
            </Col>
            <Col xs="12" md="10">
              <Row>
                <Collapse isOpen={this.state.isOpen} navbar>
                  <Nav className="ml-auto" navbar>
                  <Col xs="12" md="3">
                      <NavItem>
                        <NavLink to="/eventos" className="nav-link">¿QUÉ ES AS+?</NavLink>
                      </NavItem>
                    </Col>
                    <Col xs="12" md="3">
                      <NavItem>
                        <NavLink to="/eventos" className="nav-link">EVENTOS</NavLink>
                      </NavItem>
                    </Col>
                    <Col xs="12" md="3">
                      <NavItem>
                        <NavLink to="/beneficios" className="nav-link">BENEFICIOS</NavLink>
                      </NavItem>
                    </Col>
                    <Col xs="12" md="3">
                      <NavItem>
                        <NavLink to="/beneficios" className="nav-link">PROMOCIONES</NavLink>
                      </NavItem>
                    </Col>
                    <Col xs="12" md="3">
                      <NavItem>
                        <NavLink to="/beneficios" className="nav-link">CONTENIDOS</NavLink>
                      </NavItem>
                    </Col>                                        
                    <Col xs="12" md="3">
                      <NavItem>
                        <NavLink to="/beneficios" className="nav-link">MI CUENTA</NavLink>
                      </NavItem>
                    </Col>
                    <Col xs="12" md="3">
                      <NavItem>
                        <NavLink to="/beneficios" className="nav-link">INSCRIBITE</NavLink>
                      </NavItem>
                    </Col>
                  </Nav>
                </Collapse>
              </Row>
            </Col>
          </Row>
        </Navbar>
      </div>
    );
  }
}

DefaultHeader.propTypes = propTypes;
DefaultHeader.defaultProps = defaultProps;

export default DefaultHeader;
